import React from "react";
import "./styles.css";
import BalanceGroup from "./components/BalanceGroup";
import Profile from "./components/Profile";
import { Route, Switch } from "react-router-dom";
import Drawer from "./components/Drawer";
import { makeStyles } from "@material-ui/core/styles";
import { createMuiTheme, ThemeProvider } from '@material-ui/core/styles';
import CssBaseline from "@material-ui/core/CssBaseline";
import PFDinRegularWoff from "./fonts/PFDinTextCondPro-Regular.woff";
import PFDinBoldWoff from "./fonts/PFDinTextCondPro-Bold.woff";

const pfdinRegular = {
  fontFamily: 'PFDinTextCondPro-Regular',
  fontStyle: 'normal',
  fontDisplay: 'swap',
  fontWeight: '400',
  src: `
    local('PFDinTextCondPro-Regular'),
    url(${PFDinRegularWoff}) format('woff')
    `,
}

const pfdinBold = {
  fontFamily: 'PFDinTextCondPro-Bold',
  fontStyle: 'normal',
  fontDisplay: 'swap',
  fontWeight: '400',
  src: `
    local('PFDinTextCondPro-Bold'),
    url(${PFDinBoldWoff}) format('woff')
    `,
}

const theme = createMuiTheme({
  typography: {
    fontFamily: 'PFDinTextCondPro-Bold !important',
    fontSize: 11,
    textTransform: 'uppercase'
  },
  typographyStyle: {
    color: "red"
  },
  overrides: {
    MuiCssBaseline: {
      '@global': {
          '@font-face': [pfdinBold],
      },
    },
  },
});

const useStyles = makeStyles({
  container: {
    display: "flex"
  }
});

export default function App() {
  const classes = useStyles();
  return (
    <div className={classes.container}>
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Drawer />
        <Switch>
          <Route exact from="/" render={props => <BalanceGroup {...props} />} />
          <Route exact path="/profile" render={props => <Profile {...props} />} />
        </Switch>
    </ThemeProvider>

    </div>
  );
}
